/* eslint-disable jsx-a11y/alt-text */
import { AppBar, Button, IconButton, Link, Toolbar } from "@mui/material";
import LOGO from "../assets/logos/solxraf_navbar.png";
import { navbarLinks, socialLinks } from "../../database/NavbarData";
import { useState } from "react";
import { NavbarCSS } from "./NavbarCSS";

const Navbar = () => {
  const [hoveredIndex, setHoveredIndex] = useState(null);
  const links = {
    color: "#fff",
    textDecoration: "none",
    textTransform: "capitalize",
    padding: "23px",
    fontWeight: "700",
    "&:hover": {
      backgroundColor: "#fff2",
    },
  };

  return (
    <AppBar sx={NavbarCSS.appbar} elevation={0}>
      <Toolbar>
        <div
          style={NavbarCSS.image}
        >
          <img src={LOGO} style={{ width: "15vw" }} />
        </div>
        <div style={{ flex: 4, display: "flex", justifyContent: "center" }}>
          {navbarLinks.map((data, i) => (
            <Button
              style={{
                padding: "0",
                display: "flex",
                flexDirection: "column",
                position: "relative",
                fontSize: '0.8rem',
                fontWeight: '600'
              }}
              onClick={data.onClick}
            >
              <li
                // style={links}
                style={
                  hoveredIndex === i
                    ? { ...NavbarCSS.listItem, ...NavbarCSS.listItemHover }
                    : NavbarCSS.listItem
                }
                onMouseEnter={() => setHoveredIndex(i)}
                onMouseLeave={() => setHoveredIndex(null)}
              >
                <Link style={NavbarCSS.link} to={data.to}>
                  {data.name}
                </Link>
              </li>
              <div
              style={
                hoveredIndex === i
                  ? { ...NavbarCSS.borderDiv, ...NavbarCSS.borderDivHover }
                  : NavbarCSS.borderDiv
              }
              onMouseEnter={() => setHoveredIndex(i)}
              onMouseLeave={() => setHoveredIndex(null)}
                
              ></div>
            </Button>
          ))}
        </div>
        <div style={{ flex: 1, display: "flex", justifyContent: "center" }}>
          {socialLinks.map((data, i) => (
            <IconButton size="small">{data.icon}</IconButton>
          ))}
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
